import Header from "../../components/header/Header";
import PrestServ from "../../components/prestServ/PrestServ";

import './prestserv.css';

class Home extends Component{
    render(){
        return(
            <>
               <Header/> 
               <PrestServ/>
            </>
        )
    }
}

export default Home
